    false,nt"url": null,nt"notes": "NCEI Accession 0155758 contains raw underway
    meteorological, navigational, physical and time series data logged by the Scientific
    Computer System (SCS) aboard NOAA Ship Ronald H. Brown in the Coastal Waters of
    SE Alaska and North Pacific Ocean from 2016-06-23 to 2016-07-09. Office of Marine
    and Aviation Operations (OMAO) personnel aboard the ship submitted these data and
    associated metadata to NCEI. In addition, NCEI Accession 0155758 contains supplementary
    cruise-level metadata, which OMAO personnel logged in the Ship Daily Activity Log
    (SDAL). OMAO and NCEI personnel developed the automated process to archive these
    data under the auspices of the NOAA Rolling Deck to Repository (NOAA R2R) program.",nt"owner_org":
